import React from "react";
import useSWR from "swr";

import App from "../components/app";
import { fetcher } from "../helpers/models";

const TableApp = ({ initialData }): JSX.Element => {
    const { data, error } = useSWR("http://localhost:3000/api/employee", fetcher, { initialData });

    if (error) return <div>failed to load</div>;
    if (!data) return <div>loading...</div>;

    return <App employeesList={data} />;
};

export async function getServerSideProps() {
    const data = await fetcher("http://localhost:3000/api/employee");
    return { props: { data } };
}

export default TableApp;
